import React from 'react';
import './Result.css'; // Не забудьте создать этот CSS файл!

const Result = () => {
    return (
        <div className="result-container">
            <h1 className="title">Результат</h1>
            <p className="description">Это страница результата.</p>
            <button className="rating-button">Сформировать рейтинг</button>
        </div>
    );
};

export default Result;
